import{_ as a,c as e,o as t,V as o}from"./chunks/framework.399d643d.js";const b=JSON.parse('{"title":"每周一考-20230513","description":"","frontmatter":{},"headers":[],"relativePath":"One-week/20230513.md","lastUpdated":1686269911000}'),r={name:"One-week/20230513.md"},n=o('<h1 id="每周一考-20230513" tabindex="-1">每周一考-20230513 <a class="header-anchor" href="#每周一考-20230513" aria-label="Permalink to &quot;每周一考-20230513&quot;">​</a></h1><blockquote><p><strong>企业职工伤亡世故分类(共 20 种)</strong></p></blockquote><h2 id="物体打击" tabindex="-1">物体打击 <a class="header-anchor" href="#物体打击" aria-label="Permalink to &quot;物体打击&quot;">​</a></h2><p>指失控的物体在惯性力或重力等其他外力的作用下产生运动，打击人体而造成人身伤亡事故。不包括爆炸、主体机械设备、车辆、起重机械、坍塌等引发的物体打击。</p><h2 id="车辆伤害" tabindex="-1">车辆伤害 <a class="header-anchor" href="#车辆伤害" aria-label="Permalink to &quot;车辆伤害&quot;">​</a></h2><p>事故中受伤人员是由于车辆碰撞引起的伤害。</p><h2 id="坍塌" tabindex="-1">坍塌 <a class="header-anchor" href="#坍塌" aria-label="Permalink to &quot;坍塌&quot;">​</a></h2><p>指物体在外力或重力作用下，超过自身的强度极限或因结构稳定性破坏而造成伤害的事故，如挖沟时的土石塌方、脚手架坍塌、堆置物倒塌等，不适用于矿山冒顶片帮和车辆、起重机械、爆破引起的坍塌。</p><h2 id="帽顶片帮" tabindex="-1">帽顶片帮 <a class="header-anchor" href="#帽顶片帮" aria-label="Permalink to &quot;帽顶片帮&quot;">​</a></h2><p>矿井、涵洞、隧道开挖，因开挖、支护不当，引起顶部或侧壁大面积垮塌造成代害事故。适用于矿山、地下开采、掘进及其他坑道作业发生的坍塌事故</p><h2 id="锅炉爆炸" tabindex="-1">锅炉爆炸 <a class="header-anchor" href="#锅炉爆炸" aria-label="Permalink to &quot;锅炉爆炸&quot;">​</a></h2><p>锅炉发生的物理性爆炸事故。不适用于铁路机车、船舶上的锅炉以及列车电站船舶电站的锅炉。</p>',12),i=[n];function s(h,l,c,d,_,p){return t(),e("div",null,i)}const m=a(r,[["render",s]]);export{b as __pageData,m as default};
